In today's digital food market, a simple 5-point rating system carries significant weight. These ratings often serve as key filters, helping to narrow choices and provide an instant snapshot of a restaurant's performance. On a particular day, two restaurants received exactly five ratings each, as shown in the table. The ratings are integers, ranging from 1 to 5 inclusive, and are analyzed using the following metrics:

• The Range, which is the difference between the highest and lowest values;
• The Mean, calculated as the average of the five ratings;
• The Median, which is the middle value when the ratings are arranged in ascending or descending order;
• The Mode, the value that appears most frequently.
